-- Procedure structure for Filtrar
-- ----------------------------
DROP PROCEDURE IF EXISTS `Filtrar`;
delimiter ;;
CREATE PROCEDURE `Filtrar`(in origen varchar(100), destino varchar(100),fechainicio VARCHAR(100),fechafin varchar(100),estatus varchar(100), ciudadfiltro varchar(100))
BEGIN
	#Routine body goes here...
SELECT calldate,src,dst,duration,disposition,ciudad FROM VSucursales where (src=origen or origen is null) and  (dst=destino or destino is null) and (calldate BETWEEN fechainicio and fechafin or fechainicio is null and fechafin is null) and (disposition=estatus or estatus is null) and (ciudad=ciudadfiltro or ciudadfiltro is null);
END
;;
delimiter ;

